import React from 'react';

const ColorsList = (props) => {
  console.log(props.colors);

  let list = [];
  if (props.colors !== undefined) {
    list = props.colors.map(color => console.log(color));
  }
  return(
  <div>
    list
  </div>
  );
}

export default ColorsList;
